INSERT INTO app_product VALUES(1,'Giày Nike Revolution 7 Nam - Đen Cam',560000.0,1,'giay-nike-revolution-7-nam-den-cam-01-800x800.jpg.webp','Nike Revolution 7 được trang bị bộ đệm dày hơn cho độ êm và đàn hồi tốt hơn phiên bản trước. Phần upper với chất liệu vải mesh thoáng khi bền chắc nhưng vẫn mang đến cảm giác mềm mại cho bàn chân. Đế giữa với chất liệu React cùng với cộng nghệ Zoom nổi tiếng của Nike khiến đôi giày cực êm và phản lực tốt.');
